import React, { useState, useEffect } from 'react';

const Careers = () => {
    const [packaged, setPackages] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:3020/api/careers`)
            .then(respose => respose.json())
            .then(data => {
                setPackages(data.map(name => (
                    <div key={name.id} className="col-sm-12 col-md-4 col-lg-4 temp white-box">
                        <div><p>name: {name.name}</p></div>
                        <div><p>location: {name.career}</p></div>
                        <div><p>price: {name.type}</p></div>
                        <div><p>persons: {name.description}</p></div>
                    </div>
                )));
            });
    }, []);

    return (<div>{packaged}</div>)
}
export default Careers;
